tables.table_schema:
CREATE TABLE QuantumErrorCorrectionResults (
  experiment_id INT PRIMARY KEY,
  error_correction_success_rate FLOAT,
  timestamp TIMESTAMP
);

CREATE TABLE ErrorCorrectionMetadata (
  experiment_id INT PRIMARY KEY,
  error_code VARCHAR(50),
  quantum_system_id INT,
  error_correction_stages INT
);

CREATE TABLE error_correction_results (
    id INT PRIMARY KEY,
    experiment_id INT,
    error_rate FLOAT,
    success_rate FLOAT
);

CREATE TABLE quantum_experiments (
    id INT PRIMARY KEY,
    experiment_name VARCHAR(50),
    experiment_date DATE
);

CREATE TABLE qubits (
    id INT PRIMARY KEY,
    qubit_number INT,
    qubit_type VARCHAR(20),
    qubit_location VARCHAR(50)
);

CREATE TABLE error_types (
    id INT PRIMARY KEY,
    error_id INT,
    error_description TEXT
);

CREATE TABLE correction_data (
    correction_id INT PRIMARY KEY,
    result_id INT REFERENCES error_correction_results(result_id),
    correction_action VARCHAR(100),
    correction_time TIMESTAMP
);

CREATE TABLE success_rates (
    success_rate_id INT PRIMARY KEY,
    quantum_circuit_name VARCHAR(255),
    error_correction_success BOOLEAN,
    success_rate FLOAT
);

CREATE TABLE quantum_circuits (
    circuit_id INT PRIMARY KEY,
    circuit_name VARCHAR(255),
    circuit_description TEXT
);

CREATE TABLE researchers (
    researcher_id INT PRIMARY KEY,
    researcher_name VARCHAR(100),
    researcher_affiliation VARCHAR(255)
);
